script: |
  super -f text -I q12761.spq | sort > q12761.out

inputs:
  - name: q12761.spq
    data: |
      SELECT DISTINCT + col2 AS col1 FROM tab1 (FORMAT parquet) WHERE + - col1 - - col0 * + + ( + - col2 ) <= - 44;
  - name: tab1

outputs:
  - name: q12761.out
    data: |
      59
      68
      96
